const db = require('../../db/index.js');
const mail = require('../../utils/mail.js');
const utilities = require('../../../frontend/utils/utilities.js');

function findAll() {
  return new Promise(async (resolve, reject) => {
    const { Contacts } = await db();

    const result = await Contacts.findAll();
    resolve(result);
  });
}

function findById(id) {
  return new Promise(async (resolve, reject) => {
    const { Contacts } = await db();

    const result = await Contacts.findById(id);
    resolve(result);
  });
}

function deleteById(id) {
  return new Promise(async (resolve, reject) => {
    const { Contacts } = await db();

    const result = await Contacts.deleteById(id);
    resolve(result);
  });
}

function create({
  subject,
  subjectEmail,
  fullName,
  email,
  phone,
  message,
  ipAddress,
  token,
  sendInformation,
}) {
  return new Promise(async (resolve, reject) => {
    try {
      const isValidCaptcha = await utilities.recaptcha.validate(token);
      if (isValidCaptcha) {
        const model = {
          subject,
          fullName,
          email,
          phone,
          message,
          ipAddress,
          sendInformation,
        };
        // console.log('[db]', db);
        const { Contacts } = await db();
        const result = await Contacts.create(model);

        const from = utilities.NAME_COMPANY;
        const clientEmail = subjectEmail || utilities.EMAIL_CONTACT;
        // const clientEmail = 'daniel@it49.com';
        const subjectClient = `Message from ${utilities.DOMAIN_WEBSITE} - ${fullName}`;
        const body = `
    Subject: ${subject}<br/>
    Name: ${fullName}<br/>
    Email: ${email}<br/>
    Phone: ${phone}<br/>
    Message: ${message}<br/>
    Send me information and offers from this website: ${sendInformation ? 'Yes' : 'No'}<br/>
    `;
        //Send email to client with reply to user
        await mail.sendMail(fullName, clientEmail, email, subjectClient, body);

        const subjectUser = `Message Confirmation from ${utilities.DOMAIN_WEBSITE}`;
        const bodyClient = `
    <p>${body}</p>
    This email is a confirmation that we received your information.
    `;

        if (sendInformation) {
          //Send confirmation email to user
          await mail.sendMail(from, email, utilities.EMAIL_COMPANY, subjectUser, bodyClient);
        }

        if (!result.id) {
          reject(new Error(`Error to save ${result.error}`));
        }
        resolve(result);
      } else {
        reject(new Error('Captcha error'));
      }
    } catch (err) {
      // console.log('err', err);
      // try {
      //   await appError.create(req, res, err);
      // } catch (e) {}
      reject(err);
    }
  });
}

module.exports = {
  findAll,
  create,
  findById,
  deleteById,
};

