const requireContext = require('require-context');
const qs = require('qs');
const utilities = require('../../server/utils/utilities');

function questionDelete() {
  return confirm("Are you sure you want to delete this record?\nThis process can't be reversed.");
}

function getQuery(location) {
  return qs.parse(location.search, { ignoreQueryPrefix: true });
}

function getImages(directory, recursive, regex) {
  if (typeof window !== 'undefined') {
    console.log(directory, recursive, regex);
    return require.context('../news/', recursive, new RegExp(regex));
  }

  return requireContext(`../..${directory}`, recursive, regex);
}

module.exports = { ...utilities, questionDelete, getQuery, getImages };

