  //       splitChunks: {
  //         chunks: 'async',
  //         name: true,
  //         cacheGroups: {
  //           vendors: {
  //             name: 'vendors',
  //             chunks: 'all',
  //             reuseExistingChunk: true,
  //             priority: 1,
  //             filename: isProd ? 'assets/vendor-[hash].js' : 'assets/vendor.js',
  //             enforce: true,
  //             test(module, chunks) {
  //               const name = module.nameForCondition && module.nameForCondition();
  //               return chunks.some(
